2,'AirEuropa se significa con la eficiencia energtica','La compaa AirEuropa ha participado de nuevo en el plan de eficiencia energtica AIRE Oceanic Program..','<!--paging_filter-->\r\n<p><span><img align=\"left\" vspace=\"3\" hspace=\"4\" src=\"http://www.expreso.info/files/u8/air%20europa_0.jpg\" alt=\"\" style=\"width: 134px; height: 70px;\" />La compa&ntilde;&iacute;a </span><span>AirEuropa ha participado de nuevo en el plan de eficiencia energ&eacute;tica AIRE Oceanic Program, lanzado a mediados de 2008 por la FAA (Federal Aviation Administration) y cuyo fin es reducir al m&aacute;ximo las emisiones de gases nocivos en vuelos transoce&aacute;nicos.</span><span>&nbsp;</span></p>\r\n<div><span>La segunda fase del programa ha puesto de relieve el ahorro energ&eacute;tico que se obtiene al guiar a los aviones a su destino a trav&eacute;s de la trayectoria &oacute;ptima. </span></div>\r\n<p><br />\r\nFuente: <a rel=\"nofollow\" title=\"http://www.expreso.info/es/noticias/transporte/13091_aireuropa_se_significa_con_la_eficiencia_energetica\" href=\"http://www.expreso.info/es/noticias/transporte/13091_aireuropa_se_significa_con_la_eficiencia_energetica\">http://www.expreso.info/es/noticias/transporte/13091_aireuropa_se_significa_con_la_eficiencia_energetica</a></p>',NULL,'es','La compaa AirEuropa ha participado de nuevo en el plan de eficiencia energtica AIRE Oceanic Program...','AirEuropa se significa con la eficiencia energtica','AirEuropa se significa con la eficiencia energtica'),(72,'','','',NULL,'en','','',''),(72,'','','',NULL,'fr','','',''),(72,'','','',NULL,'it','','',''),(72,'','','',NULL,'de','','','');

